description:
Historia de cuatro amigas que examinan sus relaciones amorosas -y con ellas mismas- y que descubren que no les gusta lo ven... Jane, es una exitosa disenadora de modas que se ha descuidado y esta casada con un hombre que podria ser homosexual. Franny, una multimillonaria que aparenta tener la vida perfecta junto a su esposo e hijos. Christine se encuentra construyendo la casa de sus suenos y escribe un guion con su marido mientras ven que su vida se tambalea. La mas joven de todas es Olivia, quien trabaja limpiando casas y persigue a su ex-amante.
Amigos Con Dinero



